// App.js
import React from 'react';
import Navbar from './Navbar';
import './App.css';

function App() {
  return (
    <div className="App">
      <Navbar />
      {/* You can add your individual project components or routing here */}
      <div className="content">
        <h2>Welcome to My Machine Learning Showcase</h2>
        <p>Select a project from the navigation above to explore.</p>
      </div>
    </div>
  );
}

export default App;
